let rec foldr f b x n = 
  if(n>0) then (f x (foldr f b x (n-1))) else b
;;

let rec clone x n = 
  foldr (fun y m -> y::m) [] x n
;;


(*XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX*)

let _ = clone 3 5;;
let _ = clone "foo" 2;; 
let _ = clone clone (-3);;



let padZero l1 l2 =  if(List.length l1 > List.length l2) then 
    (l1, clone 0 (List.length l1 - List.length l2)@l2) 
  else (clone 0 (List.length l2 - List.length l1)@l1, l2)
;;

(*XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX*)

let _ = padZero [9;9] [1;0;0;2]
let _ = padZero [1;0;0;2] [9;9] 


let rec removeZero l = match l with
  |[] -> []
  | x::xs' -> if(x = 0) then removeZero xs' else x::xs'
;;

(*XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX*)

let _ = removeZero [0;0;0;1;0;0;2]
let _ = removeZero [9;9]
let _ = removeZero [0;0;0;0]


let bigAdd l1 l2 = 
  let add (l1, l2) = 
    let f a x = match x with 
      |(c,d) -> match a with 
        | (n, listSum) -> match listSum with
          | [] -> if((n+c+d)<10) then (0, [n]@[n+c+d]) else (n+1, [n+1]@[(n+c+d) mod 10])
          | h::t -> if((n+c+d)<10) then (0, 0::(c+d+h)::t) else (n+1, ((h+c+d)/10)::[(h+c+d) mod 10]@t) in
    let base = (0,[]) in
    let args = List.rev(List.combine l1 l2) in
    let (_, res) = List.fold_left f base args in
      res
  in 
    removeZero (add (padZero l1 l2))
;;
(*XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX*)

let _ = bigAdd [9;9] [1;0;0;2];;
let _ = bigAdd [9;9;9;9] [9;9;9];; 

let rec mulDigHelp i j l s = if(i=0) then [0] else if(i = j) then s else mulDigHelp i (j+1) l (bigAdd l s) 
;;

let rec mulByDigit i l = mulDigHelp i 1 l l
;;

(*XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX*)

let _ = mulByDigit 9 [9;9;9;9]

let bigMul l1 l2 = 
  let f a x = match a with 
    | (n, mulList) -> (1 + n, bigAdd((mulByDigit x l1)@clone 0 n) mulList) in
  let base = (0, []) in
  let args = l2 in
  let (_, res) = List.fold_left f base args in
    res


